class Solution(object):
    def kSmallestPairs(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[List[int]]
        """
        # upper boundary
        from math import sqrt
        N = min(int(sqrt(k)) + 1, min(len(nums1), len(nums2)))
        upper = nums1[N - 1] + nums2[N - 1]

        from heapq import heapify, heappush, heappop
        heap = list()
        heapify(heap)

        # push all items less than (N, N)
        if N * N >= k:
            for x in range(N):
                heappush(heap, (nums1[x] + nums2[x], (nums1[x], nums2[x])))

            from bisect import bisect_right
            for x in range(len(nums1)):
                target = upper - nums1[x]
                idx = bisect_right(nums2, target)
                for y in range(idx):
                    if x != y:
                        heappush(heap, (nums1[x] + nums2[y], (nums1[x], nums2[y])))
        # loop over all combinations
        else:
            for x in range(len(nums1)):
                for y in range(len(nums2)):
                    heappush(heap, (nums1[x] + nums2[y], (nums1[x], nums2[y])))

        # get smallest k
        ans = list()
        for x in range(k):
            if len(heap) > 0:
                _, pair = heappop(heap)
                ans.append(pair)
            else:
                break
        return ans


